import React from "react";
import { Paper, Box, Typography, Snackbar } from "@material-ui/core";
import { ThemeProvider } from "@material-ui/core/styles";
import { theme } from "../../theme/light";

import PropTypes from "prop-types";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import { Table, Grid, TextField ,CircularProgress} from "@material-ui/core";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import TableSortLabel from "@material-ui/core/TableSortLabel";
import Toolbar from "@material-ui/core/Toolbar";
import Checkbox from "@material-ui/core/Checkbox";
import IconButton from "@material-ui/core/IconButton";
import Tooltip from "@material-ui/core/Tooltip";
import DeleteIcon from "@material-ui/icons/Delete";
import EditIcon from "@material-ui/icons/Edit";
import Drawer from "@material-ui/core/Drawer";
import Button from "@material-ui/core/Button";
import Divider from "@material-ui/core/Divider";
import CloseIcon from "@material-ui/icons/Close";
import UserService from "../../services/user.service";
import { withStyles } from "@material-ui/core/styles";
import Alert from "@material-ui/lab/Alert";


const useStyles = (theme) => ({
  root: {
    width: "100%",
  },
  paper: {
    width: "100%",
    marginBottom: theme.spacing(2),
  },
  table: {
    minWidth: 750,
  },
  visuallyHidden: {
    border: 0,
    clip: "rect(0 0 0 0)",
    height: 1,
    margin: -1,
    overflow: "hidden",
    padding: 0,
    position: "absolute",
    top: 20,
    width: 1,
  },
});
let rows = [];

class AddBranch extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      order: "asc",
      orderBy: "calories",
      selected: [],
      page: 0,
      rowsPerPage: 5,
      top: false,
      left: false,
      bottom: false,
      right: false,
      allBranch: [],
      name: "",
      emailAddress: "",
      mobileNumber: "",
      city: "",
      address: "",
      description: "",
      errorSnack: "",
      errorMessage: "",
      isSnack: false,
      Message: "",
      isload: false,
      
    };
  }

  componentDidMount() {
    this.getAlllead();
  }

  handleRequestSort = (event, property) => {
    const { orderBy, order } = this.state;
    const isAsc = orderBy === property && order === "asc";
    this.setState({
      order: isAsc ? "desc" : "asc",
    });
    this.setState({
      orderBy: property,
    });
  };

  getAlllead = async () => {
    try {
      const response = await UserService.GetAllBranch();
      console.log("response of ssssss", response);

      const { data } = response;
      const { data: list, succeeded } = data;
      if (succeeded) {
        if (list && list.length) {
          this.setState({
            allBranch: list,
          });
          rows = list;
        }
      }
    } catch (error) {
      console.log("status error", error);
    }
  };

  handleSelectAllClick = (event) => {
    const { allBranch } = this.state;
    if (event.target.checked) {
      const newSelecteds = allBranch.map((n) => n.id);

      this.setState({
        selected: newSelecteds,
      });
      return;
    }
    this.setState({ selected: [] });
  };

  handleClick = (event, name) => {
    const { selected } = this.state;
    console.log(selected);
    const selectedIndex = selected.indexOf(name);
    let newSelected = [];

    if (selectedIndex === -1) {
      newSelected = newSelected.concat(selected, name);
    } else if (selectedIndex === 0) {
      newSelected = newSelected.concat(selected.slice(1));
    } else if (selectedIndex === selected.length - 1) {
      newSelected = newSelected.concat(selected.slice(0, -1));
    } else if (selectedIndex > 0) {
      newSelected = newSelected.concat(
        selected.slice(0, selectedIndex),
        selected.slice(selectedIndex + 1)
      );
    }

    this.setState({
      selected: newSelected,
    });
  };

  handleChangePage = (event, newPage) => {
    this.setState({ page: newPage });
  };

  handleChangeRowsPerPage = (event) => {
    this.setState({ rowsPerPage: parseInt(event.target.value, 10) });

    this.setState({ page: 0 });
  };

  toggleDrawer = (anchor, open) => (event) => {
    if (
      event.type === "keydown" &&
      (event.key === "Tab" || event.key === "Shift")
    ) {
      return;
    }
    this.setState({ [anchor]: open });
  };

  submitBranch = async () => {
    const { name, emailAddress, mobileNumber, city, address, description } =
      this.state;
      this.setState({isload: true});
    try {
      const response = await UserService.SaveBranch(
        name,
        emailAddress,
        mobileNumber,
        city,
        address,
        description
      );

      console.log("response of ssssss", response);
      this.setState({
        isSnack: true,
        Message: "Successfully Submitted",
        name: "",
        emailAddress: "",
        mobileNumber: "",
        city: "",
        address: "",
        description: "",
        isload: false
      });
      
      // const { data } = response;
      // const { data: list, succeeded } = data;
      // if (succeeded) {
      //   if (list && list.length) {
      //     this.setState({
      //       allBranch: list,
      //     });
      //     rows = list;
      //   }
      // }
    } catch (error) {
      console.log("status error", error);
      this.setState({
        errorSnack: true,
        errorMessage: "server error",
        isload: false
       
      });
    }
  };

  handleClose = (event, reason) => {
    this.setState({
      errorSnack: false,
      isSnack: false,
    });
  };

  render() {
    const { classes } = this.props;

    const {
      rowsPerPage,
      page,
      selected,
      orderBy,
      order,
      allBranch,
      name,
      emailAddress,
      mobileNumber,
      city,
      address,
      description,
      errorSnack,
      errorMessage,
      isSnack,
      Message,
      isload
    } = this.state;
    const rows = allBranch;
    const emptyRows =
      rowsPerPage -
      Math.min(rowsPerPage, allBranch.length - page * rowsPerPage);

    const isSelected = (id) => selected.indexOf(id) !== -1;
    const list = (anchor) => (
      <Box className="share-steps" height="100%">
        <Box
          display="flex"
          width="100%"
          height="100%"
          flexDirection="column"
          bgcolor="primary.drawerBg"
          className={clsx(classes.list, {
            [classes.fullList]: anchor === "top" || anchor === "bottom",
          })}
          role="presentation"
        >
          <Box className="common-content" position="relative" height="100%">
            <Box
              className="sidebar-header"
              display="flex"
              alignItems="center"
              px={3}
              py={2.4}
            >
              <Box color="text.textBlue">
                
                <Typography variant="h6" gutterBottom color="inherit">
                  Save and Update
                </Typography>
              </Box>
              <Box
                className="close-drawer cursor-pointer"
                display="flex"
                alignItems="center"
                color="grey.500"
                onClick={this.toggleDrawer(anchor, false)}
              >
                <CloseIcon color="inherit" />
              </Box>
            </Box>
            <Divider />

            <Box
              className="share-sidebar-content share-mamber-content register-container"
              p={3}
              pa
            >
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="Name"
                    variant="outlined"
                    className="custom-textfield"
                    value={this.state.name}
                    onChange={(event) => {
                      this.setState({
                        name: event.target.value,
                      });
                    }}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="Email Address"
                    value={this.state.emailAddress}
                    variant="outlined"
                    className="custom-textfield"
                    onChange={(event) => {
                      this.setState({
                        emailAddress: event.target.value,
                      });
                    }}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="Mobile Number"
                    variant="outlined"
                    className="custom-textfield"
                    value={this.state.mobileNumber}
                    onChange={(event) => {
                      this.setState({
                        mobileNumber: event.target.value,
                      });
                    }}
                  />
                </Grid>
              </Grid>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="City"
                    variant="outlined"
                    className="custom-textfield"
                    value={this.state.city}
                    onChange={(event) => {
                      this.setState({
                        city: event.target.value,
                      });
                    }}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="Address"
                    variant="outlined"
                    className="custom-textfield"
                    value={this.state.address}
                    onChange={(event) => {
                      this.setState({
                        address: event.target.value,
                      });
                    }}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    type="text"
                    label="Description"
                    variant="outlined"
                    className="custom-textfield"
                    value={this.state.description}
                    onChange={(event) => {
                      this.setState({
                        description: event.target.value,
                      });
                    }}
                  />
                </Grid>
              </Grid>

              <Box></Box>
            </Box>

            <Box
              className="sidebar-footer"
              position="absolute"
              bottom="0"
              left="0"
              width="100%"
              minHeight="82px"
              px={3}
              py={1.5}
              display="flex"
              alignItems="center"
              boxSizing="border-box"
              bgcolor="primary.drawerBg"
            >
              <Box pr={1} width="150px" boxSizing="border-box">
                <Button
                  variant="outlined"
                  className="cancel-button"
                  disableElevation
                  size="large"
                  onClick={this.toggleDrawer(anchor, false)}
                >
                  Cancel
                </Button>
              </Box>
              <Box width="150px" boxSizing="border-box">
                <Button
                  variant="contained"
                  color="primary"
                  className="next-button"
                  disabled={isload}
                  disableElevation
                  size="large"
                  onClick={() => {
                  
                    if (!name.trim()) {
                      this.setState({
                        errorSnack: true,
                        errorMessage: "please enter the name",
                      });
                    } else if (!emailAddress.trim()) {
                      this.setState({
                        errorSnack: true,
                        errorMessage: "please enter the email",
                      });
                    } else if (!mobileNumber.trim()) {
                      this.setState({
                        errorSnack: true,
                        errorMessage: "please enter the mobile number",
                      });
                    }  else {
                      this.submitBranch();
                    }
                  }}
                >
                   {isload && <CircularProgress size={16} />}
                  Save
                </Button>
              </Box>
            </Box>
          </Box>
        </Box>
        <Snackbar
          autoHideDuration={1000}
          anchorOrigin={{ vertical: "top", horizontal: "right" }}
          open={errorSnack}
          onClose={this.handleClose}
        >
          {errorMessage ? (
            <Alert onClose={this.handleClose} severity="error">
              {errorMessage}
            </Alert>
          ) : (
            ""
          )}
        </Snackbar>
        <Snackbar
          autoHideDuration={1000}
          anchorOrigin={{ vertical: "top", horizontal: "right" }}
          open={isSnack}
          onClose={this.handleClose}
        >
          {Message ? (
            <Alert onClose={this.handleClose} severity="success">
              {Message}
            </Alert>
          ) : (
            ""
          )}
        </Snackbar>
      </Box>

      // Drawer End here
    );
    return (
      <ThemeProvider theme={theme}>
        <Box className="container" p={2.5} bgcolor="primary.lightBgContainer">
          <Paper className="content lead-page">
            <Box className="page-heading" mb={3}>
              <Box color="text.secondary" pt={3} pr={2.7} pb={1.8} pl={3}>
                <Typography variant="h6" gutterBottom color="inherit">
                  Branch
                </Typography>
                {["right"].map((anchor) => (
                  <React.Fragment key={anchor}>
                    <Button onClick={this.toggleDrawer(anchor, true)}>
                      Add New Branch
                    </Button>
                    <Drawer
                      className="common-sidebar "
                      anchor={anchor}
                      open={this.state[anchor]}
                      onClose={this.toggleDrawer(anchor, false)}
                    >
                      {list(anchor)}
                    </Drawer>
                  </React.Fragment>
                ))}
              </Box>
              <Divider />
            </Box>

            <div className="data-table">
              <div className={classes.root}>
                <Paper className={classes.paper} elevation={0}>
                
                  <TableContainer>
                    <Table
                      className={classes.table}
                      aria-labelledby="tableTitle"
                      aria-label="enhanced table"
                    >
                      <EnhancedTableHead
                        classes={classes}
                        numSelected={selected.length}
                        order={order}
                        orderBy={orderBy}
                        onSelectAllClick={this.handleSelectAllClick}
                        onRequestSort={this.handleRequestSort}
                        rowCount={rows.length}
                      />
                      <TableBody>
                        {stableSort(rows, getComparator(order, orderBy))
                          .slice(
                            page * rowsPerPage,
                            page * rowsPerPage + rowsPerPage
                          )
                          .map((Lead, index) => {
                            const isItemSelected = isSelected(Lead.id);
                            const labelId = `enhanced-table-checkbox-${index}`;

                            return (
                              <TableRow
                                hover
                                onClick={(event) =>
                                  this.handleClick(event, Lead.id)
                                }
                                role="checkbox"
                                aria-checked={isItemSelected}
                                tabIndex={-1}
                                key={index}
                                selected={isItemSelected}
